import React, { Component } from 'react';
import styled from '@emotion/styled';


class Shop extends Component {
  render() {
    return (
      <React.Fragment>
        <DisplayArea>
          <ProductImage>
          </ProductImage>
          <ProductTitle>Pure Honey</ProductTitle>
          <TitleFlavor>From bear Lake Valley</TitleFlavor>
          <Description>
            This honey is all natural, all roganic, raw unpasteurized mountain flower honey.
          </Description>
        </DisplayArea>
      </React.Fragment>
    );
  }
}
export default Shop;
